import React from "react";
import  NavBar_style from "./Style/NavBar_style"


class NavBar extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }


      render() {
        return (
        <NavBar_style style={{boxShadow:'0 8px 6px -6px black'}}>
            <div style={{width:'100%'}}></div>
        </NavBar_style>
        )
      }
}


export default NavBar;
